  summary: "\nInitializes a new instance of the <xref href=\"Microsoft.AspNetCore.Mvc.ViewFeatures.ViewDataDictionary%601\" data-throw-if-not-resolved=\"false\"></xref> class based in part on an\nexisting <xref href=\"Microsoft.AspNetCore.Mvc.ViewFeatures.ViewDataDictionary\" data-throw-if-not-resolved=\"false\"></xref> instance.\n"
  remarks: "\n<p>\nFor use when copying a <xref href=\"Microsoft.AspNetCore.Mvc.ViewFeatures.ViewDataDictionary\" data-throw-if-not-resolved=\"false\"></xref> instance and <em>TModel</em> is known\nbut <xref href=\"Microsoft.AspNetCore.Mvc.ViewFeatures.ViewDataDictionary%601.Model\" data-throw-if-not-resolved=\"false\"></xref> should be copied from the existing instance e.g. when copying from a base\n<xref href=\"Microsoft.AspNetCore.Mvc.ViewFeatures.ViewDataDictionary\" data-throw-if-not-resolved=\"false\"></xref> instance to a <xref href=\"Microsoft.AspNetCore.Mvc.ViewFeatures.ViewDataDictionary%601\" data-throw-if-not-resolved=\"false\"></xref> instance.\n</p>\n<p>\nThis constructor may <code>throw</code> if <code>source.Model</code> is non-<code>null</code> and incompatible with\n<em>TModel</em>. Pass <code>model: null</code> to\n<xref href=\"Microsoft.AspNetCore.Mvc.ViewFeatures.ViewDataDictionary%601.%23ctor(Microsoft.AspNetCore.Mvc.ViewFeatures.ViewDataDictionary%2cSystem.Object)\" data-throw-if-not-resolved=\"false\"></xref> to ignore <code>source.Model</code>.\n</p>\n"
